struct point
{
    int x;
    int y;
    point(int i,int j){x=i;y=j;}
};

class Solution {
public:
    void solve(vector<vector<char> >& board) {
        int row_num = board.size();
        if(row_num == 0)
            return;
        int column_num = board[0].size();
        if(column_num == 0)
            return;
        for(int i = 0;i < row_num;i++)
        {
            BFS(board,i,0);
            BFS(board,i,column_num-1);
        }
        for(int i = 0;i < column_num;i++)
        {
            BFS(board,0,i);
            BFS(board,row_num-1,i);
        }
        for(int i = 0;i < row_num;i++)
            for(int j = 0;j < column_num;j++)
        {
            if(board[i][j] == 'O')
                board[i][j] = 'X';
            else if(board[i][j] == '*')
                board[i][j] = 'O';
        }
    }
    void BFS(vector<vector<char> >& board, int x, int y)
    {
        if(board[x][y] != 'O')
            return;
        queue<point*> my_q;
        point* tmp = new point(x,y);
        my_q.push(tmp);
        while(!my_q.empty())
        {
            point* front_point = my_q.front();
            int front_x = front_point->x;
            int front_y = front_point->y;
            board[front_x][front_y] = '*';
            int direction[4][2] = {{1,0},{-1,0},{0,1},{0,-1}};
            for(int i = 0;i < 4;i++)
            {
                int x_next = front_x+direction[i][0];
                int y_next = front_y+direction[i][1];
                if(x_next >= 0 && y_next >= 0 && x_next < board.size() && y_next < board[0].size() && board[x_next][y_next] == 'O')
                {
                    point* tmp = new point(x_next,y_next);
                    my_q.push(tmp);
                }
            }
            my_q.pop();
            delete front_point;
        }
    }
};

